import react from "react";
import styled from "styled-components";
import theme from "../../Logic/theme";

const { primary, secondar, tri, quad, background, primaryColor } = theme;

const Container = styled.div`
  width: 100%;
  grid-area: save;
  display: inline-flex;
`;

const StyledP = styled.p`
  color: ${primary};
`;

const SaveRolls = () => {
  return (
    <Container>
      <StyledP>I am roll container</StyledP>
    </Container>
  );
};

export default SaveRolls;
